+++++ _sass/variables/_mixins.scss
// Mixin for creating a pseudo element
@mixin ps {
    position: absolute;
    z-index: 1;

    &:before,
    &:after {
        content: '';
        display: block;
    }
}

// Mixin for adding a background color to elements
@mixin bg($color) {
    @if $color != 'none' {
        background-color: $color;
    } @else {
        background-color: none;
    }
}

// Mixin for centering text vertically and horizontally within an element
@mixin flex-center() {
    display: flex;
    justify-content: center;
    align-items: center;
}

// Mixin for setting the box-sizing property to border-box
@mixin bb {
    box-sizing: border-box;
}

// Mixin for creating a responsive margin
@mixin mrg($value) {
    margin-top: $value;
    margin-right: $value;
    margin-bottom: $value;
    margin-left: $value;
}
